import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Dashboard from './pages/Dashboard/Dashboard';
import User from './pages/User/User';
import Vendor from './pages/Vendor/Vendor';
import AddVendor from './pages/Product/AddVendor';
import EditVendor from './pages/Product/EditVendor';
import Order from './pages/Order/Order';
import Product from './pages/Product/Product';
import AddProduct from './pages/Product/AddProduct';
import EditProduct from './pages/Product/EditProduct';
import Contact from './pages/Contact/Contact';
import Login from './Login';
export default function Routes(){   
    return(
        <Switch>
            <Route path='/' exact component={Login} />
            <Route path='/dashboard' component={Dashboard} />
            <Route path='/user' component={User} />
            <Route path='/order' component={Order} />
            <Route path='/contact' component={Contact} />
            <Route path='/vendor' component={Vendor} />
            <Route path='/add_vendor' component={AddVendor} />
            <Route path='/edit_vendor' component={EditVendor} />
            <Route path='/product' component={Product} />
            <Route path='/add_product' component={AddProduct} />
            <Route path='/edit_product' component={EditProduct} />
        </Switch>
    )
};
